VALUES ('20807108', 'Soupe au poulet', 'eau, 6,9% brunoise de légumes (33% _céleri-rave_, 33% carotte, poireau, 10% _céleri_ en branches, oignon), 5,1% poulet grillé (97% poulet, amidon de pomme de terre, stabilisants: diphosphates, triphosphates; correcteurs d\'acidité: citrates de sodium, glycine et son sel de sodium; sel), petits pois, amidon modifié (maïs), 1.5% céleri-rave, 1% vermicelles (semoule de _blé_ dur, eau, blanc d\'_oeuf_), 1% pate de bouillon de poulet (sel, graisse de poulet, extrait de levure, amidon de pomme de terre, dextrose, arôme, correcteur d\'acidité: acide citrique; arôme naturel de _céleri_, plantes aromatiques, épices), extrait de levure, bouillon de légumes en poudre (sel, extrait de levure, amidon de pomme de terre, huile de tournesol, extraits de légumes (livèche, oignon, poireau, tomate, carotte), oignon en poudre, ail, plantes aromatiques, epices), laurier, arôme, colorant: caroténoïdes', 'https://static.openfoodfacts.org/images/products/20807108/front_fr.19.400.jpg', '0.3', '0.1', '3', '0.3', '', '1.8', '0', '0', '', '1');

