INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('20817244', 'Lemon Cake', 'Sypká směs na přípravu třeného koláče s polevou s citronovou příchutí. Bez lepku. Složení: Směs na pečení: kukuřičný škrob, cukr, kukuñičná CZ mouka, rýžová mouka, zvlhčující látka: sorbitol; kypřicí prášek (kypřicí látky: difosforečnamy, uhlíčitany sodné), přírodní citronové aroma s jinými přirodními aromaty, zahušťovadlo: guma guar; jedlá sůl. 20,75% směs na přípravu polevy: cukr, modifikovaný škrob, kyselina: kyselina citronová, přirodní aroma. Může obsahovat stopy vajec, mléka, sóji a skořápkových plodů. Skladujte v suchu a chrante před teplem. Minimáiní trvanlivost do konce: viz horní strana obalu. Dále budete potřebovat: Pro těsto: 200 g měkkého margarínu nebo másla, 4 vejce (velikost M), 25 ml (cca 2 polévkové lžíce vody). Na polevu: 25 ml (cca 2 polévkové lžíce) vlažné vody. Návod k přípravě: 1. Směs na přípravu koláče, zméklý margarin nebo máslo, vejce a vodu dejte do hnětací nádoby smícheite a třete elektrickým ručním mixérem, nejprve na nejnižší stupeň, poté zvyšte výkon a třete cca 3 minuty na maximum, dokud těsto nezíská krémovou konzistenci. 2. Pečicí formu (25 cm) vymažte a vysypte škrobem, těsto vložte dovnitř a uhladte. Tésto pečte v předehřáté troubě na střednim roštu při cca 180 °C (horní spodní ohiřev)/ 160 °C (horkovzduch) po dobu cca 60 minut. Po cca 15 minutách koláč po délce nařízněte cca 1 cm hluboko. Před vyjmutím z trouby pomocí dřevěné špejle vyzkoušejte, zda je koláč dopečený. 3. Po dopečení koláč vyjměte z formy a nechte vychladnout na kuchyñské mňžce. Směs pro přípravu polevy smíchejte s vlažnou vodou, umixujte dohladka a pomocí štětce naneste na povrch koláče. SI kolača iz umešanega testa z okusom limone, brez glutena. Sestavine: zmes za peko (koruzni škrob, sladkor, koruzna moka, riževa moka, sredstvo za ohranjanje vlage: sorbitoli; pecilni prašek (kislina: difosfati; sredstvo za vzhajanje: natrijevi karbonati), naravna aroma limone z drugimi naravnimi aromami, gostilo: guar gumi; nejodirana sol), zmes za glazuro (sladkor, modificirani škrob, kislina: citronska kislina; naravna aroma). Lahko vsebuje sledi jajc, mleka. zrnja soje in oreškov. Uporabno najmanj do konca: glej odtis na zgornjem delu embalaže. Hraniti v suhem prostoru, zaščiteno pred toploto. Navet za pripravo: potrebujete tudi: za testo: 200 g mehke margarine ali masla, 4 jajca (velikost M), 25 ml (pribl. 2 jedilni žlici) vode; za model: malo škroba: za glazuro: 25 ml (pribl. 2 jedilni žlici) mlačne vode. Priprava: 1. V posodo za mešanje stresite zmes za peko ter dodajte mehko margarino ali maslo, jajca in vodo. Z električnim ročnim mešalnikom (metlica za mešanje) mešajte kratek čas pri najnižji hitrosti in nato pribl. 3 minute pri najvišji hitrosti, da postane testo kremasto. 2. Štirikotni model (25 cm) namastite in potrosite s škrobom. Vanj nadevajte testo in ga zgladite po površini. Testo pecite v predh dno segreti pečici na srednji rešetki. Po pribl. 15 minutah peke zarežite vzdolž sredine kolača pribl. 1 cm globoko. Preden ga vzamete iz pečice, preverite z leseno palčko, ali je kolač pečen. Električna pečica (zgornje/spodnje grelo): pribl. 180 °C, ventilacijska pečica: pribl. 160 °C. Čas peke: pribl. 60 minut. 3. Po končani peki ločite kolač od modela. Postavite ga na kuhinjsko rešetko, da se ohladi. Zmes za glazuro dobro zmešajtez mlačno vodo, nato jo s pomočja noža nanesite na kolač.HR Praškasta mješavina za kolač s okusom limuna. Bez glutena. Sastojci: praškasta mješavina [kukuruzni škrob, sećer, kukuruzno brašno, rižino brašno, tvar za zadržavanje vlage: sorbitoli; prašak za pecivo (kiselina: difosfati; tvar za rahljenje: natrijevi karbonati), priradna aroma limuna s drugim prirodnim aromama, zgušnjivač: guar guma; kuhinjska sol], mješavina za glazuru (šećer, modificirani škrob, kiselina: limunska kiselina; prirodna aroma). Može sadržavati tragove jaja, mlijeka, soje i orašastog voća. Cuvati na hladnom i suhom mjestu. Najbolje upotrijebiti ds kraja: otisnuto na gornjem dijelu ambalaže. Potrebno je dodati: za tijesto: 200 g omekšalog margarina ili maslaca, 4 jaja (veličina M) i 25 ml (cca 2 žlica) vode. Za kalup: malo škroba. Za glazuru: 25 ml (cca 2 žlice) mlake vode. Priprema: 1. Mješavinu za tijesto, omekšali margarin ili maslac, jaja i vodu staviti u zdjelu. Električnim mikserom (nastavci za miješanje) prvo kratko promiješati na najnižoj brzini, a zatim na najvećoj brzini miješati cca 3 minute do kremaste konzistencije. 2. Kalup (25 cm) namastiti i posuti škrobom, tijesto staviti u kalup i poravnati. Peći na srednjoj rešetci u prethodno zagrijanoj pećnii. Nakon cca 15 minuta kolač razrezati po sredini cca 1 cm u dubinu. Prije vađenja isprobati čačkalicom da li je kolač pečen. Pećnica s gornjim donjim zagrijavanjem: cca 180 °C. Pećnicas cirkulacijom zraka: cca 160 °C. Vrijeme pečenja: cca 60 minuta. 3. Kada je pečen, kolač izvaditi iz kalupa istaviti na rešetku kako bi se ohladio. Mješavinu za glazuru pomiješati s mlakom vodom i nožem nanijeti na kolač. Zemlja podrijetla: Njemačka. GR/CY Meip yia παρασκευή γλυκού με λεμόνι. Χωρίς γλουτένη . Συστατικά: Μείγμα για τη βάση: άμυλο αραβοσίτου, ζάχαρη, αλεύρι καλαμποκιού, ρυζάλευρο, υγροσκοπικά μέσα: σορβιτόλες, διογκωτική σκόνη (μέσο οξίνισης: διφωσφορικά άλατα, διογκωτικό αρτοποιίας: ανθρακικά άλατα νατρίου ) , φυσική αρωματική ύλη από λεμό με αλες φυσικές αρωματικές ύλες , πυκνωτικό μέσο: κόμμι γκουάρ , μαγειρικό αλάπ. Μείγμα γλάσου: ζάχαρη, Τροποποιημένο άμυλο, μέσο οξισης κπρικό οξυ. φυσική αρωματική ύλη. Μπορεί να περιέχει μερος και προστατεύστε το από την υψηλή θερμοκρασία. Ανάλωση κατά προτίμηση πριν από το τέλος: βλέπε καπάκι . Προσθέστε επιπλέον: Για τη ζύμης 200g μαλακή μαργαρίνη ή βούτυρο, 4 αυγά Gotova zmes za peko ίχνη από αυγό, γάλα, σόγια, φυστίκια αράπικα (αραχίδες) και καρπούς με κέλυφος. Διατηρήστε τ σε ξηρό (μέγεθος Μ) , 25 ml (περίπου 2 κουταλιές της σούπας) νερό . Για το σκεύος: λίγο άμυλο. Για το γλάσο: 25 ml (περίπου 2 ης σουπας) χλιαρό νερό . Εκτέλεση: 1. Τοποθετήστε το μείγμα για την παρασκευή του γλυκού, τη μαλακή μαργαρίνη ή το βούτυρο, το αυγο και το νερό σε ένα βαθύ σκεύος, Χτυπήστε με το μίξερ (ή σύρμα χειρός ) στη μικρή σκάλα για αρχή και μετά χτυπήστε το στη μεγαλύτερη σκάλα γα περίπου 3 λεπτά μέχρι να γίνει κρεμδες . 2. Βουτυρστε μία φόρμα ψησίματος (25 εκατοστά) και πασπαλίστε με άμυλο, βάλτε το μείγμα μέσα και απλστε το. Ψήστε την Τούρτο στην μεσαία σχάρα σε προθερμασμένο φούρνο. Μετά από περίπου 15 λεπτά Ψησίματος κόψτε το Υλυκό κατά του μήκους του στη μέση σε βάθος περίπου 1 εκατοστό , Πριν το βγάλετε ελέγξτε με μία οδοντογλυφίδα αν το γλυκό έχει Ψηθεί . Θερμοκρασία πάνω / κάτω: περίπου 180C, φούρνος με αέρα: περίπου 160-C. TO Χρόνος ψησίματος: περίπου 60 λεπά. 3. Μετά το Ψήσιμο βγάλτε το γλυκό από τη φόρμα ψησίματος και αφήστε το να κρυσει πάνω σε μια οχάρα . Χτυτήστε Το μείγμα του γλάσου με χλιαρό νερό μέχρι να έχετε μία λεία μάζα και τοποθετήστε Το με ένα πινέλο στο γλυκό . Παρασκευάζεται στη Γερμανία για την Εταιρεία: Lidl Hellas & Σια Ο.Ε., ΒΙ.ΠΕ. Θεσ/νίκης, Ο.Τ. 31, ΔΑ 13, 57022 Σίνδος-Δήμος Δέλτα, Ελλάδα. Výživové údaje/Hranilna vrednost/Hranjive vrijednosti/ Διατοοοική δήλωση %RI 0/61 g* @/100 g*', 'https://static.openfoodfacts.org/images/products/20817244/front_hr.3.400.jpg', '', '', '', '', '', '', '', '', '', '1');

