VALUES ('20822781', 'Tortelloni', '69% Egg Pasta (Durum Wheat Semolina, Wheat Flour, 16.7% Egg), 31% Ricotta Cheese and Spinach Filling (41% Ricotta Cheese (Milk), Breadcrumbs [Wheat Flour, Water, Yeastl, Water, Sunflower Oil, 10% Spinach, Whey Powder (Milk), Salt, Grated Cheese (Milk) (contains Preservative: Egg Lysozyme), Flavourings). Allerg Advice: For allergens, including Cereals containing Gluten, see ingredients in bold. May also contain Crustaceans and Fish. Cooking Instructions: The following are guidelines only. Some appliances may vary. Remove all packaging before cooking. Hob: Bring a saucepan of lightly salted water to the boil. Add the tortelloni, reduce the heat and simmer for 5-6 minutes. Drain well and serve With a sauce of your choice. Ensure food is piping hot and cooked throughout before serving. Do not reheat. Storage Instructions: Keep refrigerated. Once opened, use within 3 days and by the use by date. Use by: see front of pack. Additional Information: Packaged in a protective atmosphere. Produced in Italy using EU milk. Disposal: Packaging - Not Currently Recyclable. Please check With your local council for further recycling information.', 'https://static.openfoodfacts.org/images/products/20822781/front_fr.4.400.jpg', '7.5', '3.9', '43.9', '3.3', '', '11.6', '1', '0.393700787401575', '', '1');

