VALUES ('20841577', 'Bûche aux 2 Chocolats', '99% macarons moelleux, mousses de chocolat noir et de chocolat au lait : sucre, crème (lait) (crème (lait), stabilisant : carraghénanes), eau, 8,8% amandes, œuf 1 entier, 7,3% chocolat noir (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithines (soja) ; extrait de vanille), lait entier, beurre (lait), farine de maïs, 3% chocolat au lait (sucre, beurre de cacao, lait entier en poudre, pâte de cacao, lait écrémé en poudre, émulsifiant : lécithines (soja) ; arôme naturel de vanille), 2,5% blanc d\'œuf 1 en poudre (2,4% blanc d\'œuf 1, correcteur d\'acidité : acide citrique ; agent moussant : citrate de triéthyle), jaune d\'œufl sucré (jaune d\'œuf 1, sucre), cacao en poudre, gélatine de bœuf, farine de blé, amidon de manioc, arôme naturel de vanille. 1% décor : amandes effilées. Traces éventuelles d\'autres fruits à coque. 1 Issu de poules élevées en plein air. Conseil de dégustation : pour conserver au produit toute sa qualité, prévoir de sortir la bûche du congélateur en début de matinée pour un déjeuner, ou en début d\'après-midi pour un dîner, et la placer sous sa cloche dans le bas du réfrigérateur. Si vous êtes pressé, vous pouvez sortir la bûche du congélateur, et la laisser à température ambiante (environ +200C) sous sa cloche environ 1 heure. Ce produit se savoure frais.', 'https://static.openfoodfacts.org/images/products/20841577/front_fr.4.400.jpg', '27', '12', '30', '29', '', '10', '0.18', '0.0708661417322835', '', '0');

